const Images_preview = ({ Images, OnChange }) => {
  console.log("Images_preview");
  console.log(Images);

  const Images_Show = Images.map((Element, index) => {
    console.log(Element);
    return (
      <div class="four wide column">
        <img key={index} src={Element} />
      </div>
    );
  });

  return <div class="ui grid">{Images_Show}</div>;
};

export default Images_preview;
